/const sendDeleteRetrieveMessage = async (jid, store) => {
    try {
        // Step 1: Send a message to the chat
        const response = await sock.sendMessage(jid, { text: 'Hello!' });
        console.log('Message sent:', response);

        // Step 2: Delete the message (for everyone)
        await sock.sendMessage(jid, { delete: response.key });
        console.log('Message deleted:', response.key);

        // Step 3: Retrieve the deleted message from the store
        const message = await store.loadMessage(jid, response.key.id);
        if (message?.message) {
            console.log('Retrieved deleted message:', message);
            // Send the retrieved message back to the chat
            await sock.sendMessage(jid, { text: `Retrieved deleted message: ${message.message}` });
        } else {
            console.log('No message found in the store for this delete event.');
        }

    } catch (error) {
        console.error('Error in send, delete, retrieve process:', error.message);
    }
};

const jid = message.key.remoteJid;  // Replace with an actual valid JID
sendDeleteRetrieveMessage(jid, store);

